import { Pipe, PipeTransform } from '@angular/core';
import {User} from "../entity/User";

@Pipe({
  name: 'filterUsers'
})
export class FilterUsersPipe implements PipeTransform {

  transform(users: User[], search: string): unknown {
    return users.filter(u => u.name)
  }

}
